import React, {Component} from 'react'
import './App.css';
import  NewPage from './stories/NewPage';

class App extends Component {
  render() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="container">
        <NewPage />
        </div>
      </header>
    </div>
  );
  }
}

export default App;
